import PropTypes from 'prop-types';
// import { BtnList } from './Feedback.styled';

export const Feedback = ({ options, onLeaveFeedback }) => {
  return (
    <div>
      <h2>Please leave feedback</h2>
      {options.map(option => (
        <button type="button" onClick={() => onLeaveFeedback('option')}>
          {option}
        </button>
      ))}
    </div>
  );
};
